import React from "react";

class ProjectList extends React.Component {
  constructor(props) {
    super(props);
    this.state = { projects: this.props.projects };
  }

  render() {
    console.log(this.state);

    const projects = this.state.projects;
    projects.map(item => {
      return (
        <li key={item.id}>
          <h1>{item.name}</h1>
        </li>
      );
    });

    return (
      <div>
        <ul>{projects}</ul>
      </div>
    );
  }
} //END OF CLASS

export default ProjectList;
